css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain(www.linuxdistrocommunity.com){
body {color: #F7F7F7 !important;}
input, textarea, select {color: #F7F7F7;background-color: #000000;border-color: #1A1615;-moz-appearance: none !important;}
SPAN[style='color: #1AAF36;'] {color: #9FB378 !important;}
SPAN[style='color: #2932B8;'] {color: #6EA2A6 !important;}
body {background-color: #080807 !important;color: #F7F7F7 !important;}
a:link {color: #7DC4A4 !important;}
a:visited {color: #7DC4A4 !important;}
a:hover, a:active {color: #F7F7F7 !important;}
#container {background-color: #000000 !important;border-top-color: #1A1A1A !important;border-right-color: #1A1A1A !important;border-bottom-color: #1A1A1A !important;border-left-color: #1A1A1A !important;color: #F7F7F7 !important;}
.menu ul {color: #F7F7F7 !important;}
.menu ul a:link {color: #F7F7F7 !important;}
.menu ul a:visited {color: #F7F7F7 !important;}
.menu ul a:hover, .menu ul a:active {color: #73978B !important;}
#panel {background-color: #080807 !important;color: #F7F7F7 !important;border-top-color: #2A2A2A !important;border-right-color: #2A2A2A !important;border-bottom-color: #2A2A2A !important;border-left-color: #2A2A2A !important;}
table {color: #F7F7F7 !important;}
.tborder {background-color: #213831 !important;border-top-color: #91C5AD !important;border-right-color: #91C5AD !important;border-bottom-color: #91C5AD !important;border-left-color: #91C5AD !important;}
.thead {background-image: url("data:image/png;base64,") !important;background-repeat: repeat-x !important;color: #000000 !important;}
.thead a:link {color: #000000 !important;}
.thead a:visited {color: #000000 !important;}
.thead a:hover, .thead a:active {color: #000000 !important;}
.tcat {background-color: #0F241D !important;color: #F7F7F7 !important;}
.tcat a:link {color: #F7F7F7 !important;}
.tcat a:visited {color: #F7F7F7 !important;}
.tcat a:hover, .tcat a:active {color: #F7F7F7 !important;}
.trow1 {background-color: #050505 !important;}
.trow2 {background-color: #080807 !important;}
.trow_shaded {background-color: #0E020B !important;}
.trow_selected td {background-color: #100402 !important;}
.trow_sep {background-color: #0D0D0C !important;color: #F7F7F7 !important;}
.tfoot {background-image: url("data:image/png;base64,") !important;background-repeat: repeat-x !important;color: #000000 !important;}
.tfoot a:link {color: #000000 !important;}
.tfoot a:visited {color: #000000 !important;}
.tfoot a:hover, .tfoot a:active {color: #000000 !important;}
.bottommenu {background-color: #080807 !important;color: #F7F7F7 !important;border-top-color: #73978B !important;border-right-color: #73978B !important;border-bottom-color: #73978B !important;border-left-color: #73978B !important;}
.navigation {color: #F7F7F7 !important;}
.navigation .active {color: #F7F7F7 !important;}
input.textbox {background-color: #000000 !important;color: #F7F7F7 !important;border-top-color: #91C5AD !important;border-right-color: #91C5AD !important;border-bottom-color: #91C5AD !important;border-left-color: #91C5AD !important;}
textarea {background-color: #000000 !important;color: #F7F7F7 !important;border-top-color: #91C5AD !important;border-right-color: #91C5AD !important;border-bottom-color: #91C5AD !important;border-left-color: #91C5AD !important;}
select {background-color: #000000 !important;border-top-color: #91C5AD !important;border-right-color: #91C5AD !important;border-bottom-color: #91C5AD !important;border-left-color: #91C5AD !important;}
.editor {background-color: #070706 !important;border-top-color: #313131 !important;border-right-color: #313131 !important;border-bottom-color: #313131 !important;border-left-color: #313131 !important;}
.editor_control_bar {background-color: #000000 !important;border-top-color: #91C5AD !important;border-right-color: #91C5AD !important;border-bottom-color: #91C5AD !important;border-left-color: #91C5AD !important;}
.autocomplete {background-color: #000000 !important;border-top-color: #F7F7F7 !important;border-right-color: #F7F7F7 !important;border-bottom-color: #F7F7F7 !important;border-left-color: #F7F7F7 !important;color: #F7F7F7 !important;}
.autocomplete_selected {background-color: #0F241C !important;color: #F7F7F7 !important;}
.popup_menu {background-color: #191918 !important;border-top-color: #F7F7F7 !important;border-right-color: #F7F7F7 !important;border-bottom-color: #F7F7F7 !important;border-left-color: #F7F7F7 !important;}
.popup_menu .popup_item {background-color: #000000 !important;color: #F7F7F7 !important;}
.popup_menu .popup_item:hover {background-color: #0B1814 !important;color: #F7F7F7 !important;}
.trow_reputation_positive {background-color: #121603 !important;}
.trow_reputation_negative {background-color: #160310 !important;}
.reputation_positive {color: #CCD49F !important;}
.reputation_neutral {color: #B5B5B5 !important;}
.reputation_negative {color: #AB4D9D !important;}
.invalid_field {border-top-color: #AB4D8A !important;border-right-color: #AB4D8A !important;border-bottom-color: #AB4D8A !important;border-left-color: #AB4D8A !important;color: #AB4D8A !important;}
.valid_field {border-top-color: #B1BD6C !important;border-right-color: #B1BD6C !important;border-bottom-color: #B1BD6C !important;border-left-color: #B1BD6C !important;}
.validation_error {color: #AB4D8A !important;}
.validation_success {color: #BAC57D !important;}
.validation_loading {color: #A5A5A5 !important;}
.selectall {background-color: #100402 !important;}
img.attachment {border-top-color: #211B1B !important;border-right-color: #211B1B !important;border-bottom-color: #211B1B !important;border-left-color: #211B1B !important;}
hr {background-color: #7C7B76 !important;color: #F7F7F7 !important;}
blockquote {border-top-color: #313131 !important;border-right-color: #313131 !important;border-bottom-color: #313131 !important;border-left-color: #313131 !important;background-color: #000000 !important;}
blockquote cite {border-bottom-color: #313131 !important;}
.codeblock {background-color: #000000 !important;border-top-color: #313131 !important;border-right-color: #313131 !important;border-bottom-color: #313131 !important;border-left-color: #313131 !important;}
.codeblock .title {border-bottom-color: #313131 !important;}
.highlight {background-color: #160803 !important;}
.pm_alert {background-color: #1B0604 !important;border-top-color: #934246 !important;border-right-color: #934246 !important;border-bottom-color: #934246 !important;border-left-color: #934246 !important;}
.red_alert {background-color: #0C030A !important;border-top-color: #B980B2 !important;border-right-color: #B980B2 !important;border-bottom-color: #B980B2 !important;border-left-color: #B980B2 !important;color: #B980B2 !important;}
.high_warning {color: #BD6CB1 !important;}
.moderate_warning {color: #9C4D76 !important;}
.low_warning {color: #C68098 !important;}
div.error {border-top-color: #934246 !important;border-bottom-color: #934246 !important;background-color: #1B0604 !important;}
div.error p {color: #F7F7F7 !important;}
div.error p em {color: #BD6CB1 !important;}
.online {color: #B2BB84 !important;}
.offline {color: #363636 !important;}
.pagination a {border-top-color: #4D665E !important;border-right-color: #4D665E !important;border-bottom-color: #4D665E !important;border-left-color: #4D665E !important;}
.pagination .pagination_current {background-color: #050505 !important;border-top-color: #4D665E !important;border-right-color: #4D665E !important;border-bottom-color: #4D665E !important;border-left-color: #4D665E !important;color: #F7F7F7 !important;}
.pagination a:hover {background-color: #050505 !important;}
.success_message {color: #BAC57D !important;}
.error_message {color: #BD6CB1 !important;}
._neutral {background-color: #020202 !important;color: #636363 !important;border-top-color: #313131 !important;border-right-color: #313131 !important;border-bottom-color: #313131 !important;border-left-color: #313131 !important;}
._minus {background-color: #14040F !important;color: #BD6DB0 !important;border-top-color: #CC8EC2 !important;border-right-color: #CC8EC2 !important;border-bottom-color: #CC8EC2 !important;border-left-color: #CC8EC2 !important;}
._plus {background-color: #0F0D03 !important;color: #C9D199 !important;border-top-color: #C9D199 !important;border-right-color: #C9D199 !important;border-bottom-color: #C9D199 !important;border-left-color: #C9D199 !important;}
.pagination_breadcrumb {background-color: #050505 !important;border-top-color: #000000 !important;border-right-color: #000000 !important;border-bottom-color: #000000 !important;border-left-color: #000000 !important;outline-color: #313131 !important;}
img[src^="http://www.linuxdistrocommunity.com/forums/images/logo.gif"] {background-image: url("data:image/png;base64,") !important;background-repeat: no-repeat !important;width: 0px !important;padding-right: 420px !important;height: 0px !important;padding-bottom: 100px !important;}

}
